/*
import './App.css';
*/
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import Settings from './components/Settings';
import Visuallizations from './components/Visuallizations';
import './components/style/styie.css';
import { AiFillSmile } from "react-icons/ai";

function App() {
  return (
    <div className="container">
      <Router>

            <div className="left-column">
            <Sidebar />
            </div>
            <div className="center-column">
            <Switch>
              <Route exact path="/"><Dashboard/></Route>
              <Route path="/Settings"><Settings/></Route>
              <Route path="/Visuallizations"><Visuallizations/></Route>
            </Switch>  
            </div>
            <div className="right-column">
                <ul>
                    <li><AiFillSmile/>Dashboard </li>
                    <li><AiFillSmile/>Default</li>
                    <li><AiFillSmile/>eCommerce</li>
                    <li><AiFillSmile/>Projects</li>
                </ul>

            </div>

      </Router>
    </div>
    /*
    <div>
      <Router>
        <Sidebar />
        <hr />
        <Switch>
          <Route exact path="/"><Dashboard/></Route>
          <Route path="/Settings"><Settings/></Route>
          <Route path="/Visuallizations"><Visuallizations/></Route>
        </Switch>
      </Router>
    </div>
    */
  );
}

export default App;
